import React from "react";
import  "./artist.css"
// import Gallery from '../../assets/img/gallery.png';
import IconOne from '../../assets/img/001.png';
import IconTwo from '../../assets/img/002.png';
import IconThree from '../../assets/img/003.png';
import IconFour from '../../assets/img/004.png';
import IconFive from '../../assets/img/005.png';

import { useState } from "react";
import Slider from "react-slick";
import galleryOne from '../../assets/img/marterium-1.png'
import galleryTwo from '../../assets/img/marterium-2.png'
import galleryThree from '../../assets/img/marterium-3.png'
import galleryFour from '../../assets/img/marterium-4.png'
import { FaArrowRight, FaArrowLeft } from "react-icons/fa";

const images = [galleryOne, galleryTwo, galleryThree, galleryFour]


const Artist = () => {

    const NextArrow = ({ onClick }) => {
        return (
          <div className="arrow next" onClick={onClick}>
            <FaArrowRight />
          </div>
        );
      };

      const PrevArrow = ({ onClick }) => {
        return (
          <div className="arrow prev" onClick={onClick}>
            <FaArrowLeft />
          </div>
        );
      };

    //   const [imageIndex, setImageIndex] = useState(0);

    const settings = {
        infinite: true,
        lazyload: true,
        speed: 300,
        slidesToShow: 3,
        centerMode: true,
        centerPadding: 0,
        nextArrow: <NextArrow />,
        prevArrow: <PrevArrow />
    };

    return (
        <div className="artist" id="the-artist">
            <div className="section">
                <div className="left">
                {/* <img src={Gallery} alt="The Void logo" className="gallery"></img> */}
                {/* <Carousel slides={slides}/> */}
                <Slider>
                    {images.map((img, idx) => (
                        <div>
                            <img serc={img} alt={img} />
                        </div>
                    ))}
                </Slider>
                </div>
                <div className="right">
                    <h2>MEET THE ARTIST: MARTERIUM</h2>
                    <p>THE VOID IS PROUD TO ANNOUNCE THAT WE HAVE PARTNERED WITH RENOWNED ARTIST, MARTERIUM, FOR THE CREATION OF OUR VOID PASS. MARTERIUM'S UNIQUE AND HIGH QUALITY ART WORK IS SOMETHING WE ARE EXCITED TO PROVIDE OUR COMMUNITY AND WE ARE EVEN MORE EXCITED TO HAVE HIM AS ONE OF OUR TRUSTED ADVISORS ON THE VOID GOVERNANCE COUNCIL.</p>
                    <div className="icons">

                    <a href="https://www.instagram.com/marterium/" target="blank"><img src={IconOne} alt="The Void logo" className="social"></img></a>

                     <a href="https://twitter.com/Marterium_" target="blank"><img src={IconTwo} alt="The Void logo" className="social"></img></a>

                     <a href="https://www.pinterest.de/marterium/" target="blank"><img src={IconThree} alt="The Void logo" className="social"></img></a>

                     <a href="https://www.behance.net/marterium" target="blank"><img src={IconFour} alt="The Void logo" className="social"></img></a>

                     <a href="https://marterium.com/nft" target="blank"><img src={IconFive} alt="The Void logo" className="social"></img></a>

                    </div>

                </div>
            </div>
        </div>
    )
}

export default Artist
